import React from "react";
import './App.css';
import {BrowserRouter, Navigate,Route,Routes,useNavigate,} from "react-router-dom";
import GeneralPage from './pages/generalPage';
import MyGrievance from './pages/myGrievance';
import Login from "./pages/login";
import Signup from "./pages/signup";
import Hostel from "./pages/Hostel";
import Canteen from "./pages/Canteen";
import Department from "./pages/Department";
import Giveapproval from "./pages/Admin/giveapproval";

function App() {
  return (
    <BrowserRouter>
    <Route path="/" exact component={GeneralPage} />
    <Route path="/mygrievance" component={MyGrievance} />
    <Route path="/login" component={Login} />
    <Route path="/signup" component={Signup} />
    <Route path="/hostel" component={Hostel} />
    <Route path="/department" component={Department} />
    <Route path="/canteen" component={Canteen} />
    <Route path="/giveapproval" component={Giveapproval} />
    </BrowserRouter>
  );
}

export default App;
